import axios from 'axios';
export const alertUnsavedChanges = async (details) => {
    try {
        const profileDB = await axios.get('/api/profile');
        if (JSON.stringify(details) === JSON.stringify(profileDB.details)) {
        }
    } catch (err) {
        console.log('@@@ Unsaved Changes - Profile @@@', err);
    }
};
